import { createWebHistory, createRouter } from "vue-router";
import HelloWorld from '@/components/firstStep.vue'
import HelloWorld2 from '../components/secondStep.vue'

const routes = [
    {
        path: "/",
        name: "HelloWorld",
        component: HelloWorld,
    },
    {
        path: "/secondStep",  // TestComponent.vue로 이동할 Path
        name: "HelloWorld2",  // router name
        component: HelloWorld2,  // Path로 이동될 Component
    },
];

const router = createRouter({
    history: createWebHistory(),
    routes,
});

export default router;
